import React from "react";

class MovieTab extends React.Component {
    render() {
        return (
            <ul className="tabs nav nav-pills">
                <li className="nav-item">
                    <div className="nav-link active">
                        Popularity desc
                    </div>
                </li>
                <li className="nav-item">
                    <div className="nav-link">
                        Revenue desc
                    </div>
                </li>
                <li className="nav-item">
                    <div className="nav-link">
                        Vote avetage
                    </div>
                </li>
            </ul>
        );
    }
}

export default MovieTab;
